import React from 'react';
import { AppBar, Toolbar, Typography, Box, IconButton } from '@mui/material';
import BatteryAlertIcon from '@mui/icons-material/BatteryAlert';
import SignalCellularAltIcon from '@mui/icons-material/SignalCellularAlt';
import AccessTimeIcon from '@mui/icons-material/AccessTime';

const TopBar = () => {
  return (
    <AppBar position="sticky" sx={{ backgroundColor: '#0f172a', color: '#fff' }}>
      <Toolbar>
        <Box sx={{ flexGrow: 1 }}>
          <Typography variant="h6">Drone Command HQ</Typography>
        </Box>

        {/* Status Icons */}
        <IconButton color="inherit" aria-label="battery">
          <BatteryAlertIcon />
        </IconButton>
        <IconButton color="inherit" aria-label="signal">
          <SignalCellularAltIcon />
        </IconButton>
        <IconButton color="inherit" aria-label="time">
          <AccessTimeIcon />
        </IconButton>
      </Toolbar>
    </AppBar>
  );
};

export default TopBar;
